import React, {Component} from 'react';
import './App.css';
import Header from './components/header/Header';
import About from './components/about/About';

class App extends Component {
    render() {
        return (
            <div className="App">
                <Header/>
                <About/>
            </div>
        );
    }
}

export default App;
